import './custom-button.scss';
import { CustomButtonContainer } from './custom-button.style';

const CustomButton = ({
  children,
  isGoogleSignin,
  inverted,
  ...otherProps
}) => {
  return (
    <CustomButtonContainer
      className={`${inverted ? 'inverted' : ''} ${
        isGoogleSignin ? 'google-sign-in' : ''
      } custom-button`}
      {...otherProps}
    >
      {children}
    </CustomButtonContainer>
  );
};

export default CustomButton;
